import axios from 'axios';

const api = axios.create({
  baseURL: 'https://127.0.0.1:8000/', // replace with your Django server address
});


export const postFormData = async (data) => {
  try {
    const requestOptions = {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: data
    };
    fetch('https://127.0.0.1:8000/myapp/post-data/', requestOptions)
      .then(response => response.json())
      .then(data => console.log(data))
      .catch(error => console.error(error));
  } catch (error) {
    console.log("hi")
    console.error(error.message);
  }
};

export const getFormData = async () => {
  try {
    const response = await api.get('/myapp/get-data/');
    return response.data;
  } catch (error) {
    console.error(error);
  }
};
